import React from 'react';
import { BrowserRouter as Router, Route, Link, Routes } from 'react-router-dom';
import matchData from '../Data/MatchData.json';

const MatchList = () => {
    return (
      <section className="p-4">
        <h2 className="text-xl font-bold mb-4">Maç Listesi</h2>
        <Router>
          <Routes>
            {matchData.matches.map((match) => (
              <Route key={match.date} path={`/matches/${match.date}`} element={<MatchDetail match={match} />} />
            ))}
            <Route path="/matches" element={<MatchDateList />} />
          </Routes>
        </Router>
      </section>
    );
  };

  const MatchDateList = () => {
    return (
      <ul>
        {matchData.matches.map((match) => (
          <li key={match.date}>
            <Link to={`/matches/${match.date}`}>{match.date}</Link>
          </li>
        ))}
      </ul>
    );
  };

  const MatchDetail = ({ match }) => {
    return (
      <div>
        <h2>{match.date}</h2>
        <p>{match.team1} vs {match.team2}</p>
        {/* Diğer maç detay bilgilerini buraya ekleyebilirsiniz */}
      </div>
    );
  };

  export default MatchList;
